        h2 {
          color: #FBFBFF;
          font-family: "bold";
          font-size: 10px;
          font-style: "bold";
          font-weight: 700;
          line-height: normal;
          margin: 0;
        }

        p {
          color: #FBFBFF;
          font-family: "regular";
          font-size: 8px;
          font-style: "regular";
          font-weight: 400;
          line-height: normal;
          margin: 0;
        }

        .body {
          display: flex;
          padding: 16px 24px;
          align-items: center;
          gap: 32px;
          border-radius: 16px;
          background: #040F16;
        }

        .widget {
          display: flex;
          flex-direction: column;
          border-radius: 8px;
          width: 123px;
          overflow: hidden;
          border-radius: 8px;
          background: linear-gradient(0deg, rgba(255, 255, 255, 0.27) 0%, rgba(255, 255, 255, 0.27) 100%), #040F16;
        }

        .widget:hover .widget-header {
          background: #6b7b91;
        }

        .widget-header {
          padding: 8px;
          justify-content: space-between;
          display: flex;
          align-items: center;
          background: #828DA1;
        }

        .widget-body {
          display: flex;
          padding: 4px 8px 8px 8px;
          align-items: flex-start;
          gap: 10px;
          align-self: stretch;
        }
        
        .col-1 {
          display: flex;
          flex-direction: column;
          align-items: flex-start;
          gap: 8px;
        }

        .col-2 {
          display: flex;
          width: 277px;
          flex-direction: column;
          align-items: center;
          gap: 10px;
          flex-shrink: 0;
        }

        .icon {
          display: flex;
          padding: 2px;
          align-items: flex-start;
          gap: 10px;
          border-radius: 50%;
          background: #040F16;
        }

        .rectangle-1 {
          animation-name: rectangle-1;
          animation-duration: 2s;
          animation-timing-function: cubic-bezier(.25,.1,.25,1);
          animation-iteration-count: infinite;
          animation-direction: alternate;
        }

        .rectangle-2 {
          animation-name: rectangle-2;
          animation-duration: 2s;
          animation-delay: 1s;
          animation-timing-function: cubic-bezier(.25,.1,.25,1);
          animation-iteration-count: infinite;
          animation-direction: alternate;
        }

        @keyframes rectangle-1 {
          0% {
            transform: translate(0px, 0px)
          }
          100% {
            transform: translate(0px, 8px)
          }
        }
        @keyframes rectangle-2 {
          0% {
            transform: translate(0px, 0px)
          }
          100% {
            transform: translate(0px, -8px)
          }
        }
